import React from 'react';

import Keep from './static/keep.png'


const Nav = () => {
    return (
        <>
            <div id="navBar">
                <img src={Keep} alt="Error" />
                <h1>Jarviz Note</h1>
            </div>

        </>
    )
}

export default Nav;
